import React from 'react';
import Link from 'next/link';

const Card = React.forwardRef(({ id, name, email }, ref) => {
  return (
    <Link href={{ pathname:`robots/${id}`, query:{ name, email } }}>
      <div ref={ref}>
        <img src={`https://robohash.org/${id}?size=200x200`} alt='robots' />
        <div>
          <a ref={ref}>{name}</a>
          <p>{email}</p>
        </div>
      </div>
    </Link>
  );
});

export default Card;
